module.exports = JSON.parse('[{"id":"what-is-url","title":"URL: Comprehensive Introduction to Uniform Resource Locator","excerpt":"URL: Uniform Resource Locator for locating internet resources. It consists of protocol, domain name, path, query string, and fragment identifier. Enables easy access to web pages, images, files, and more through a simple text format.","content":"URL, short for Uniform Resource Locator, is a string used to locate and identify resources on the internet. URL is one of the foundations of the modern internet, allowing us to access web pages, images, videos, files, and other online resources through a simple text format. [|] URL consists of several components, each serving a specific purpose and functionality. Here are the main components of a URL: [|] 1. Protocol: The protocol specifies the communication protocol required to access the resource, such as HTTP (Hypertext Transfer Protocol), HTTPS (HTTP Secure), FTP (File Transfer Protocol), etc. The protocol is typically located at the beginning of the URL, followed by a colon and two slashes (e.g., http:// or https://). [|] 2. Domain Name: The domain name uniquely identifies a computer or network on the internet. It can be a hostname (e.g., www.example.com) or an IP address (e.g., 192.168.0.1). The domain name follows the protocol and is usually separated by a slash. [|] 3. Path: The path specifies the location of the resource on the server. It is a string separated by slashes, used to identify the directory structure or file location on the server. The path comes after the domain name and can contain multiple levels as needed. [|] 4. Query String: The query string is used to pass parameters and data to the server. It begins with a question mark (?) and is followed by parameters represented in key-value pairs. Multiple parameters are separated by an ampersand (&). [|] 5. Fragment Identifier: The fragment identifier specifies a specific section or anchor within a webpage or document. It starts with a hash (#) followed by the name or identifier of the fragment. Fragment identifiers are commonly used to point to specific parts within a page. [|] Example of a URL: [|] Suppose we want to access an image named \\"pic.jpg\\" on a website called example.com, located at /images/ path, with parameters width=500 and height=300. The corresponding URL might be: http://www.example.com/images/pic.jpg?width=500&height=300 [|] URL serves the purpose of identifying and locating resources on the internet. Through URLs, we can conveniently access various online resources, whether it\'s web pages, images, or other types of files. Understanding the structure and components of a URL helps us better comprehend and utilize the internet."}]');

