module.exports = JSON.parse('[{"id":"what-is-url","title":"URL:통합 리소스 로케이터 전체 소개","excerpt":"URL: 인터넷 리소스를 찾는 데 사용되는 통합 리소스 로케이터입니다.프로토콜, 도메인 이름, 경로, 쿼리 문자열, 슬라이스 ID로 구성됩니다.간단한 텍스트 형식을 통해 웹 페이지, 이미지, 파일 등에 쉽게 액세스할 수 있습니다.","content":"URL은 Uniform Resource Locator의 약어로, 인터넷에서 리소스를 찾고 식별하는 데 사용되는 문자열입니다.URL은 웹 페이지, 이미지, 비디오, 파일 및 기타 온라인 리소스에 간단한 텍스트 형식을 통해 액세스할 수 있도록 하는 현대 인터넷의 기본 중 하나입니다. [|] URL은 여러 구성 요소로 구성되며 각 구성 요소에는 특정 용도와 기능이 있습니다.다음은 URL의 주요 구성 요소입니다. [|] 1. 프로토콜: 이 프로토콜은 HTTP(Hypertext Transfer Protocol), HTTPS(HTTP 보안 프로토콜), FTP(File Transfer Protocol) 등과 같은 리소스 액세스에 필요한 통신 프로토콜을 지정합니다. 이 프로토콜은 일반적으로 URL의 시작 부분에 위치하며 콜론과 두 개의 슬래시(예: http:// 또는 https://)가 뒤따릅니다. [|] 2. 도메인 이름: 도메인 이름은 인터넷에서 컴퓨터 또는 네트워크를 고유하게 식별합니다.호스트 이름(예: www.Example.com) 또는 IP 주소(예: 192.168.0.1)일 수 있습니다.도메인 이름은 프로토콜을 따르며 일반적으로 슬래시로 구분됩니다.[|]3. 경로: 서버에서 리소스의 위치를 지정합니다.슬래시로 구분된 문자열로, 서버의 디렉토리 구조 또는 파일 위치를 식별합니다.경로는 도메인 이름 뒤에 필요에 따라 여러 수준을 포함할 수 있습니다. [|] 4. 쿼리 문자열: 쿼리 문자열은 매개 변수와 데이터를 서버에 전달하는 데 사용됩니다.물음표(?)로 시작합니다.뒤에 키-값 쌍으로 표시된 매개변수가 붙습니다.여러 매개변수는 번호(&)로 구분됩니다. [|] 5. 조각 식별자: 스니펫 식별자는 웹 페이지 또는 문서의 특정 부분 또는 앵커를 지정합니다.해시(#)로 시작하고 그 뒤에 단편의 이름이나 식별자가 붙습니다.스니펫 식별자는 일반적으로 페이지의 특정 부분을 가리키는 데 사용됩니다. [|] URL 예: [|] /Images/Path, 매개 변수 Width=500, Height=300에 있는 Example.com이라는 웹 사이트에 있는 \\"pic.jpg\\"라는 그림에 액세스하려고 한다고 가정합니다.해당 URL은 다음과 같습니다. http://www.Example.com/Images/pic.jpg?Width=500&High=300[|] URL은 인터넷에서 리소스를 식별하고 찾는 데 사용됩니다.URL을 통해 웹 페이지, 이미지 또는 기타 유형의 파일 등 다양한 온라인 리소스에 편리하게 액세스할 수 있습니다.URL의 구조와 구성을 이해하면 인터넷을 더 잘 이해하고 활용하는 데 도움이 됩니다."}]');

