"use strict";
module.exports = JSON.parse('[{"id":"what-is-url","title":"URL：统一资源定位符的全面介绍","excerpt":"URL: 统一资源定位符，用于定位互联网资源。包含协议、域名、路径、查询字符串和片段标识符等组成部分。通过简单文本格式，方便访问网页、图片和文件等资源。","content":"URL，全称为统一资源定位符（Uniform Resource Locator），是用于定位和标识互联网上资源的字符串。URL是现代互联网的基础之一，它允许我们通过简单的文本方式访问网页、图像、视频、文件和其他在线资源。 [|] URL由多个部分组成，每个部分都具有特定的含义和功能。下面是URL的主要组成部分： [|] 1. 协议（Protocol）：协议指定了访问资源所需使用的通信协议，例如HTTP（超文本传输协议）、HTTPS（HTTP安全版本）、FTP（文件传输协议）等。协议通常位于URL的开头，后跟冒号和两个斜杠（如http://或https://）。 [|] 2. 域名（Domain Name）：域名是唯一标识互联网上计算机或网络的名称。它可以是一个主机名（如www.example.com），也可以是一个IP地址（如192.168.0.1）。域名紧随协议后面，通常以斜杠作为分隔符。 [|] 3. 路径（Path）：路径指定了资源在服务器上的位置。它是一个由斜杠分隔的字符串，用于标识服务器上的目录结构或文件位置。路径位于域名之后，可以根据需要包含多个层级。 [|] 4. 查询字符串（Query String）：查询字符串用于向服务器传递参数和数据。它以问号（?）开头，后面跟随以键值对形式表示的参数。多个参数之间使用和号（&）分隔。 [|] 5. 片段标识符（Fragment Identifier）：片段标识符指定了网页或文档中的特定片段或锚点。它以井号（#）开头，后面跟随片段的名称或标识符。片段标识符通常用于指向页面内的特定部分。 [|] URL的示例： [|] 假设我们要访问一个名为example.com的网站上的一张图片，路径为/images/pic.jpg，并附带参数width=500和height=300。对应的URL可能是：http://www.example.com/images/pic.jpg?width=500&height=300 [|] URL的中文翻译为统一资源定位符，它的作用是标识和定位互联网上的资源。通过URL，我们可以方便地访问各种在线资源，无论是网页、图片还是其他类型的文件。了解URL的结构和组成部分可以帮助我们更好地理解和使用互联网。"}]');

